import React from 'react'
import { Rutas, Link, BrowserRouter } from 'react-router-dom'
import { Error } from '../components/Error'
import { InicioDeSesion } from '../components/InicioDeSesion'
import { RegistroUsuario } from '../components/RegistroUsuario'
import '../index.css'

export const RouterPrincipal = () => {
  return (
    <BrowserRouter>

       {/*Cargar los componentes*/}
       {/*Aqui se cargan los componentes que conciden con el path*/}
        <Routes>
            <Route path="/" element={<InicioDeSesion/>}/>
            <Route path="/inisiodesesion" element={<InicioDeSesion/>}/>
            <Route path="/registrousuario" element={<RegistroUsuario/>}/>
            <Route path="*" element={<Error/>}/>  
        </Routes>

    </BrowserRouter>
  )
}
